import React from 'react';
import './styles.css';

const TodoApp = () => {
    return (
        <div>
            <h1>TodoApp</h1>
            <hr />

            <ul>
                <li>Hola</li>
                <li></li>
                <li></li>
            </ul>
        </div>
    )
}

export default TodoApp;
